import React from 'react';
/*yarn add react-router-dom should be installed first*/
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
import Home from '../co/home/home.component';
import AboutMe from '../components/AboutMe/AboutMe.js';
import { ContactForm } from '../components/Contact/Contact.js';


import './App.css';

function App() {
  return (
    <div >

        <Router>
          <ul className="options">
            <li><a href><Link to={'/'} className="option"> Home </Link></a></li>
            <li><a href><Link to={'/aboutme'} className="option">AboutMe</Link></a></li>
            <li><a href><Link to={'/contact'} className="option">Contact</Link></a></li>
          </ul>

          <Switch>
              <Route exact path="/" component={Home} />
              <Route path="/about" component={AboutMe} /> 
              <Route path="/contact" component={ContactForm} />    
          </Switch>
        </Router>

    </div>
  );
}

export default App;
